import React from 'react';
import './App.css';

function App() {
  return (
    <div class="card">
      <div class="card-body">
        <h5 className="card-title">Steve Jobs</h5>
        <h6 className="card-subtitle mb-2 text-muted">steve@apple.com</h6>
        <p class="card-text">Stay Hungry, Stay Foolish</p>
      </div>
    </div>
  );
}

export default App;
